// Dashboard.js: Starting fresh with 3 main analytics (Revenue Over Time, Job Type Revenue, Avg Duration & Hourly Rate)

import React, { useState, useEffect } from 'react';
import { useAuth } from '../contexts/AuthContext';
import { Line, Bar } from 'react-chartjs-2';
import { fetchAnalytics } from '../api/dashboardApi'; // Updated API call for analytics

const Dashboard = () => {
  const { user } = useAuth();
  const [timeRange, setTimeRange] = useState('30'); // Default: Past 30 days
  const [analytics, setAnalytics] = useState({
    revenueOverTime: null,
    revenueByJobType: null,
    averageDurationAndRate: null,
    pastDueRecurring: null
  });

  useEffect(() => {
    fetchDashboardAnalytics();
  }, [timeRange]);

  const fetchDashboardAnalytics = async () => {
    try {
      const response = await fetchAnalytics(timeRange);
      setAnalytics(response); // Update with the response from the backend
    } catch (error) {
      console.error('Error fetching analytics:', error);
    }
  };

  // Render 3 analytics at a time with manageable container sizes
  const renderAnalytics = () => {
    return (
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {/* Revenue Over Time */}
        <div className="bg-gray-800 p-4 rounded-lg shadow">
          <h3 className="text-lg font-medium text-white">Revenue Over Time</h3>
          {analytics.revenueOverTime && (
            <Line
              data={{
                labels: analytics.revenueOverTime.labels,
                datasets: [{
                  label: 'Revenue',
                  data: analytics.revenueOverTime.data,
                  borderColor: 'rgb(75, 192, 192)',
                  tension: 0.1
                }]
              }}
              options={{
                responsive: true,
                scales: {
                  x: { type: 'time' },
                  y: { beginAtZero: true }
                }
              }}
            />
          )}
        </div>

        {/* Revenue by Job Type */}
        <div className="bg-gray-800 p-4 rounded-lg shadow">
          <h3 className="text-lg font-medium text-white">Revenue by Job Type</h3>
          {analytics.revenueByJobType && (
            <Bar
              data={{
                labels: ['One-Time', 'Recurring'],
                datasets: [{
                  label: 'Revenue',
                  data: [
                    analytics.revenueByJobType.oneTime,
                    analytics.revenueByJobType.recurring
                  ],
                  backgroundColor: ['#FF6384', '#36A2EB']
                }]
              }}
              options={{ responsive: true, scales: { y: { beginAtZero: true } } }}
            />
          )}
        </div>

        {/* Average Duration & Hourly Rate */}
        <div className="bg-gray-800 p-4 rounded-lg shadow">
          <h3 className="text-lg font-medium text-white">Avg. Duration & Hourly Rate</h3>
          {analytics.averageDurationAndRate && (
            <div className="mt-2">
              <p className="text-xl text-white">Duration: {analytics.averageDurationAndRate.averageDuration.toFixed(2)} mins</p>
              <p className="text-xl text-white">Hourly Rate: ${analytics.averageDurationAndRate.hourlyRate.toFixed(2)}</p>
            </div>
          )}
        </div>
      </div>
    );
  };

  return (
    <div className="min-h-screen bg-gray-900 text-white">
      <Header />
      <main className="max-w-7xl mx-auto py-6 px-4 sm:px-6 lg:px-8">
        {/* Time Range Selector */}
        <div className="flex justify-between items-center mb-6">
          <h1 className="text-3xl font-bold">Welcome, {user?.name || 'User'}</h1>
          <select
            value={timeRange}
            onChange={(e) => setTimeRange(e.target.value)}
            className="bg-gray-800 text-white px-4 py-2 rounded-md"
          >
            <option value="7">Past 7 days</option>
            <option value="30">Past 30 days</option>
            <option value="90">Past 90 days</option>
            <option value="365">Past Year</option>
          </select>
        </div>

        {/* Quick Actions */}
        <div className="mb-8">
          <h2 className="text-2xl font-semibold mb-4">Quick Actions</h2>
          {/* (Keep your Quick Actions code as-is here) */}
        </div>

        {/* Analytics */}
        {renderAnalytics()}
      </main>
    </div>
  );
};

export default Dashboard;
